import React from 'react'
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Login from '../pages/Login';
import Register from '../pages/Register/index';

export default function MainRoutes() {
    return ( <
        BrowserRouter >
        <
        Switch >
        <
        Route exact = { true }
        path = "/"
        component = { Login }
        /> <
        Route path = "/register"
        component = { Register }
        /> <
        /Switch> <
        /BrowserRouter>
    );
}
